        <div class="scolley-div" :style="{ height: screenHeight + 'px'}">
            <group label-width="4.5em">
                <image-picker
                    :files="imageList"
                    :companyId="userLogin.companyId"
                    :selectable="imageList.length<1"
                    multiple
                    @onChange="fliesChange"
                />
                <x-input title="<span style='color: red;'>*</span>名称" :show-clear="false"
                         placeholder="" v-model="postDinnerData.dinnerName" class="fontColor"></x-input>
                <cell title="分类" :value="clazzName" @click.native="chooseDinnerClazz" is-link></cell>
                <x-textarea title="描述" :max="2000" placeholder=""
                            v-model="postDinnerData.dinnerDescribe" class="fontColor"></x-textarea>
            </group>
            <group v-for="(item, index) in postmodelData" :key="index" label-width="4.5em">
                <group-title slot="title" style="height: 15px;">
                    <i v-show="postmodelData.length > 1" class="iconfont icon-shanchu2" v-on:click="delModel(index)"
                       style="float: right;font-size: 30px;margin-top: -11px;margin-right: -10px;"></i>
                </group-title>
                <x-input title="<span style='color: red;'>*</span>关联" readonly :show-clear="false" v-model="item.productName"
                         placeholder="请选择关联物品"  class="fontColor" @click.native="chooseGoods(index)"></x-input>
                <x-input title="<span style='color: red;'>*</span>价格" type="number" :show-clear="false" v-model="item.dinnerPrice"
                         placeholder="" class="fontColor"></x-input>
                <x-input title="<span style='color: red;'>*</span>库存" type="number" :show-clear="false" v-model="item.dinnerCount"
                         placeholder="" class="fontColor"></x-input>
                <x-input title="型号" :show-clear="false" placeholder="" v-model="item.modelName" class="fontColor"></x-input>
            </group>
            <group>
                <flexbox>
                    <flexbox-item>
                        <x-button @click.native="addModel">增加型号</x-button>
                    </flexbox-item>
                </flexbox>
            </group>
            <group>
                <flexbox :gutter="0">
                    <flexbox-item>
                        <x-button class="btn-common" type="primary" @click.native="addUpdateDinner">提交</x-button>
                    </flexbox-item>
                </flexbox>
            </group>
        </div>
        <div>
            <x-dialog v-model="showDialog" class="chooseClazz" hide-on-blur>
                <checklist ref="demoObject" title="" :options="clazzNameList" :max="1" v-model="clazzId"></checklist>
                <group>
                    <flexbox :gutter="0">
                        <flexbox-item>
                            <x-button class="btn-common" type="primary" @click.native="getClazz($refs.demoObject.getFullValue())">选择</x-button>
                        </flexbox-item>
                    </flexbox>
                </group>
            </x-dialog>
        </div>
        <popup v-model="showGoodsList"  style="height:100%;width:100%;background-color:#fff" position="right" :popup-style="{'overflow': 'hidden'}">
            <goods-list ref="goodsListRef" :isComeBack="false" :isReferenced="true" @doSome="doSome" @loadGoods="loadGoods" @goodsItemClick="goodsItemClick"></goods-list>
        </popup>
    </div>
</template>

<script>
    import { XTextarea, XInput, Group, XButton, Flexbox, FlexboxItem, Selector, GroupTitle,Cell,XDialog,Checklist,Popup } from "vux";
    import ZingHead from "@/components/zingHead/ZingHead";
    import ImagePicker from 'components/imagepicker/ImagePicker';
    import GoodsList from "@/container/ziyuanku/goodsWarehouse/goodsList";
    import { isPc,getThumbUrl } from '@/utils/fn'
    import { dateFormat } from '@/utils/date'
    export default {
        name: "dinnerAddEdit",
        components: {
            Selector,Group,GroupTitle,XTextarea,XInput,XButton,Flexbox,FlexboxItem,ZingHead,ImagePicker,Cell,XDialog,Checklist,Popup,GoodsList
        },
        props: {
            dinnerItem: {
                default: {}
            }
        },
        data: () => ({
            title:"添加菜品",//标题
            showDialog:false,//弹框隐藏显示
            showGoodsList: false,//资源库商品弹框
            clazzNameList: [],
            clazzId:[],//分类名称
            clazzName:"",//分类名称
            imageList:[],//图片列表
            screenHeight: 0,//页面高度
            modelIndex:0,
            userLogin:{},
            postmodelData:[{ //菜品属性数据
                modelName:"",//菜品属性../..
                dinnerPrice:"",//菜品价格
                dinnerCount:"",//菜品数量
                saleCount:"0",//销售数量（统计此菜品的销售情况）
                productId:"",//关联菜品的id  资源库的菜品ID
                productName:""//关联菜品的名称 资源库的菜品ID
            }],
            postDinnerData:{ //菜品提交数据
                dinnerClazzId:"",//菜品对应的分类id
                dinnerName:"",//菜品标题
                dinnerDescribe:"",//菜品描述
                dinnerDetailText : "",
                dinnerStatus : "0",//菜品状态
                salesCount : "0",//销售数量
            }
        }),
        watch:{
            dinnerItem : {
                handler(curVal,oldVal) { //
                    this.clazzId = curVal.dinnerData.dinnerClazzId ? [curVal.dinnerData.dinnerClazzId] : []
                    this.clazzNameList = [];
                    for (let i = 0; i < curVal.clazzData.length; i++) {
                        this.clazzNameList.push({
                            key: curVal.clazzData[i].dinnerClazzId ? curVal.clazzData[i].dinnerClazzId : "",
                            value: curVal.clazzData[i].dinnerClazzName ? curVal.clazzData[i].dinnerClazzName : ""
                        })
                        if (curVal.dinnerData.dinnerClazzId && curVal.dinnerData.dinnerClazzId === curVal.clazzData[i].dinnerClazzId) {
                            this.clazzName = curVal.clazzData[i].dinnerClazzName
                        }
                    }
                    if (curVal.type === "edit") {
                        this.title = "编辑菜品";
                        this.postDinnerData = curVal.dinnerData;
                        this.postmodelData = curVal.dinnerData.dinnerModelInfo;
                        this.imageList = [];
                        curVal.dinnerData.dinnerImg.split(" ").forEach(item => {
                            this.imageList.push({ url:item.replace(new RegExp("//"), "/") });
                        });
                    } else if (curVal.type === "add") {
                        this.title = "添加菜品";
                        this.imageList = [];
                        this.clazzName = ""
                        this.postmodelData = [{ //菜品属性数据
                            modelName:"",//菜品属性../..
                            dinnerPrice:"",//菜品价格
                            dinnerCount:"",//菜品数量
                            saleCount:"0",//销售数量（统计此菜品的销售情况）
                            productId:"",//关联菜品的id  资源库的菜品ID
                            productName:""//关联菜品的名称 资源库的菜品ID
                        }]
                        this.postDinnerData = { //菜品提交数据
                            dinnerClazzId:"",//菜品对应的分类id
                            dinnerName:"",//菜品标题
                            dinnerDescribe:"",//菜品描述
                            dinnerDetailText : "",
                            dinnerStatus : "0",//菜品状态
                            salesCount : "0",//销售数量
                        }
                    }
                },
                deep:true
            },
        },
        created() { //
            this.screenHeight = document.documentElement.clientHeight - 50;
            this.loadUserMsg()
        },
        methods: {
            closeMethod() {
                this.$emit("closeMethod");
            },
            loadUserMsg() {
                let url = "/zingbiz/auth/user/getThisUserInfo";
                let that = this;
                this.$http
                    .post(url, {})
                    .then(res => {
                        that.userLogin = res.data.data;
                    })
                    .catch(err => {
                        console.log(err);
                    });
            },
            delModel(index) { //删除型号
                if (this.postmodelData.length > 1) {
                    this.postmodelData.splice(index,1)
                }
            },
            addModel() { //添加型号
                this.postmodelData.push({
                    modelName:"",//菜品属性../..
                    dinnerPrice:"",//菜品价格
                    dinnerCount:"",//菜品数量
                    saleCount:"0",//销售数量（统计此菜品的销售情况）
                    productId:"",//关联菜品的id  资源库的菜品ID
                    productName:""//关联菜品的名称 资源库的菜品ID
                });
            },
            chooseGoods(index) {
                this.modelIndex = index
                this.showGoodsList = true;
            },
            doSome() {
                this.showGoodsList = false;
            },
            loadGoods() {
                this.$refs.goodsListRef.loadGoods();
            },
            goodsItemClick(item) {
                console.log(item)
                this.postmodelData[this.modelIndex].productName = item.productName
                this.postmodelData[this.modelIndex].dinnerPrice = item.xsPrice
                this.postmodelData[this.modelIndex].dinnerCount = item.productCount
                this.postmodelData[this.modelIndex].productId = item.rowId
                this.showGoodsList = false;
            },
            //上传图片组件方法
            fliesChange(files, operationType, index) {
                let images = []
                if (operationType === "add") {
                    for (let i = 0; i < files.length; i++) {
                        images.push(files[i].url)
                    }
                    this.$nextTick(() => {
                        this.imageList = files;
                    })
                    this.postDinnerData.dinnerImg = images.join(" ")
                }
                if (operationType === "remove") {
                    for (let i = 0; i < files.length; i++) {
                        images.push(files[i].url)
                    }
                    this.$nextTick(() => {
                        this.imageList = files;
                    })
                    this.postDinnerData.dinnerImg = images.join(" ")
                }
            },
            chooseDinnerClazz() {
                if (this.dinnerItem.clazzData.length === 0) {
                    let that = this
                    this.$vux.confirm.show({
                        title: '提示',
                        content: '没有可选的分类,去添加分类',
                        onCancel () { that.$vux.confirm.hide(); },
                        onConfirm () {
                            that.$router.push({ path: "/dinner/dinnerClazz" });
                        }
                    })
                } else {
                    this.showDialog = true
                }
            },
            getClazz(val) {
                if (val.length > 0) {
                    this.clazzName = val[0].label
                    this.clazzId = [val[0].value]
                    this.postDinnerData.dinnerClazzId = val[0].value
                    this.showDialog = false
                }
            },
            addUpdateDinner() { //添加修改方法
                if (!this.postDinnerData.dinnerName) {
                    this.$vux.toast.text("菜品名称不能为空", 'bottom')
                    return false
                }
                if (!this.postDinnerData.dinnerClazzId) {
                    this.$vux.toast.text("请选择菜品分类", 'bottom')
                    return false
                }
                if (!this.imageList.length) {
                    this.$vux.toast.text("请上传一张图片", 'bottom')
                    return false
                }
                if (!this.postmodelData.length) {
                    this.$vux.toast.text("请填写商品规格信息", 'bottom')
                    return false
                }
                let dinnerPriceList = []
                let modelA = []
                for (let i = 0; i < this.postmodelData.length; i++) {
                    if (!this.postmodelData[i].dinnerPrice) {
                        this.$vux.toast.text("菜品价格不能为空", 'bottom')
                        return false
                    }
                    if (!this.postmodelData[i].productName) {
                        this.$vux.toast.text("请选择关联关系", 'bottom')
                        return false
                    }
                    if (!this.postmodelData[i].dinnerCount) {
                        this.$vux.toast.text("库存不能为空", 'bottom')
                        return false
                    }
                    dinnerPriceList.push(this.postmodelData[i].dinnerPrice)
                    let modelObj = {
                        productId:this.postmodelData[i].productId,
                        saleCount:this.postmodelData[i].saleCount,
                        productName:this.postmodelData[i].productName,
                        dinnerPrice:this.postmodelData[i].dinnerPrice,//parseFloat(this.postmodelData[i].dinnerPrice).toFixed(2),
                        modelName:this.postmodelData[i].modelName,
                        dinnerCount:this.postmodelData[i].dinnerCount
                    }
                    modelA.push(modelObj)
                }
                this.postDinnerData.dinnerPriceMin = parseFloat(Math.max.apply(null,dinnerPriceList)).toFixed(1)//菜品最低价格
                let short = getShortName(this.postDinnerData.dinnerName)
                this.postDinnerData.dinnerShortName = short.arrW.join(" ")//菜品简称
                this.postDinnerData.dinnerInitial = short.arrWN.join(" ")
                let mas = "添加"
                for (let i = 0; i < this.postmodelData.length; i++) {
                    if (this.postmodelData[i].modelId) {
                        mas = "修改"
                        break
                    }
                }
                let params = {
                    dinnerClazzId:this.postDinnerData.dinnerClazzId,
                    dinnerDescribe:this.postDinnerData.dinnerDescribe,
                    dinnerDetailText:this.postDinnerData.dinnerDetailText,
                    dinnerId:this.postDinnerData.dinnerId ? this.postDinnerData.dinnerId : "",
                    dinnerImg:this.postDinnerData.dinnerImg,
                    dinnerInitial:this.postDinnerData.dinnerInitial,
                    dinnerName:this.postDinnerData.dinnerName,
                    dinnerPriceMin:this.postDinnerData.dinnerPriceMin,
                    dinnerShortName:this.postDinnerData.dinnerShortName,
                    dinnerStatus:this.postDinnerData.dinnerStatus,
                    genTime:this.postDinnerData.genTime ? this.postDinnerData.genTime : dateFormat(new Date()),
                    onlineTime:this.postDinnerData.onlineTime ? this.postDinnerData.onlineTime : dateFormat(new Date()),
                    salesCount:this.postDinnerData.salesCount ? this.postDinnerData.salesCount : "",
                    /*dinnerTag : "",
                    marketStartTime : "00:00:00",
                    marketEndTime : "23:59:59",
                    marketCycle : "周一 周二 周三 周四 周五 周六 周日",
                    isWeigh : "0",
                    dinnerUnit : "",*/
                }
                params.dinnerModelList = JSON.stringify(modelA)
                console.log(params)
                let that = this
                let url = "/zingbiz/dinner/saveOrUpdateDinner";
                this.$vux.loading.show({
                    text: '正在提交...'
                })
                this.$http
                    .post(url, params)
                    .then(res => { //加载一个仓库数据dinner/dinnerManage
                        this.$vux.loading.hide()
                        if (res.data.success) {
                            this.$emit("closeMethod");
                            that.$vux.toast.show({ text:mas + "成功",type:"success",onHide (){ }})
                        } else {
                            that.$vux.toast.show({ text:mas + "失败",onHide(){ } })
                        }
                });
            }
        }
    };

